.PARAMETER Method
Default = InjectRemote: shellcode.boo injection method to call.

.PARAMETER Path
Default = .\shellcode.boo: Path to the shellcode.boo source

.EXAMPLE
Invoke-JumpScare

.EXAMPLE
Invoke-JumpScare -Arch x64 -Method InjectRemote -Path .\shellcode.boo

